import React from 'react';

const Login = () => {
  return (
    <div id="login-screen">
      <form action="" method="post" enctype="multipart/form-data">
        <input type="text" name="username"/>
        <input type="password" name="password"/>
        <button type="submit" value="login"/>
      </form>
    </div>
  );
}

export default Login;
